import React from 'react';
import './DevelopmentSuite.css';

const JavaScriptLogo = require('./../../../../assets/javascript.png'),
      ReactLogo      = require('./../../../../assets/react.png'),
      HtmlLogo       = require('./../../../../assets/html.png')

function DevelopmentSuite() {
    return (
      <div className="row" style={{paddingBottom: "100px"}}>
          <div className="two-col-format-column development-suite-album">
              <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript" className="large polaroid img1" style={{textAlign: "center"}}>
                  <img src={JavaScriptLogo} alt="javascript logo"/> Javascript
              </a>
              <a href="https://reactjs.org/docs/getting-started.html" className="medium polaroid img2" style={{textAlign: "center"}}>
                  <img src={ReactLogo} alt="react logo"/> React
              </a>
              <a href="https://developer.mozilla.org/en-US/docs/Web/Guide/HTML/HTML5" className="medium polaroid img3" style={{textAlign: "center"}}>
                  <img src={HtmlLogo} alt="html logo"/> HTML
              </a>
          </div>
          <div className="two-col-format-column" style={{paddingRight: "10vw"}}>
              <p>
                  Next, it was time to select the suite of developmer tools to make the website come to life.
              </p>
          </div>
      </div>
    );
}

export default DevelopmentSuite;
